0=Tour 02-1@Operation: Elimination@Location: Along the coast of Odesa, 
1=USSR@--------------------------------------------------@@Captain, we 
2=have uncovered a Soviet spy amongst our operatives. Unfortunately, he 
3=has left his post and fleeing towards the Soviet camp, leaving the 
4=Allies with a compromised position. Eliminate him before he 
5=irreparably damages the Allied defences in the region. @@The spy is 
6=advising the Soviets on Allied activity, so he is not likely to leave 
7=the region. @@A field hospital is available to tend to your wounds. 
8=Ensure that the hospital remain standing to allow your continued 
9=operation in the region. 

